import React from 'react';
import HeroSection from '../../components/landingpage/HeroSection.js';
import AboutUs from './../../components/landingpage/AboutUs';
import Services from './../../components/landingpage/Services';
import Portfolio from './../../components/landingpage/Portfolio';
import Testimonials from './../../components/landingpage/Testimonials';
import ContactUs from './../../components/landingpage/ContactUs';
import FAQ from './../../components/landingpage/FAQ';
// import "./../../css/landingPage.css";

const LandingPage = () => {
  return (
    <div>
      <header style={{ 
        position: 'fixed', 
        top: 0, 
        left: 0, 
        right: 0, 
        backgroundColor: '#00183d', 
        zIndex: 1000, 
        padding: '10px 20px', 
        display: 'flex', 
        alignItems: 'center', 
        justifyContent: 'space-between' 
      }}>
        <img src={require('./../../assets/logo.png')} alt="Logo" style={{ height: '40px' }} />
        <nav>
          <ul style={{ display: 'flex', listStyleType: 'none', margin: 0, padding: 0 }}>
            <li style={{ marginRight: '20px' }}>
              <a href="#about-us" style={{ color: 'white', textDecoration: 'none' }}>About Us</a>
            </li>
            <li style={{ marginRight: '20px' }}>
              <a href="#services" style={{ color: 'white', textDecoration: 'none' }}>Services</a>
            </li>
            <li>
              <a href="#portfolio" style={{ color: 'white', textDecoration: 'none' }}>Portfolio</a>
            </li>
          </ul>
        </nav>
      </header>

      <div style={{ paddingTop: '60px' }}> {/* Add padding to prevent content from hiding behind the header */}
        <HeroSection />

        <div id="about-us">
          <AboutUs />
        </div>
        <div id="services">
          <Services />
        </div>
        <div id="portfolio">
          <Portfolio />
        </div>

        <Testimonials />
        <ContactUs />
        <FAQ />
      </div>
    </div>
  );
};

export default LandingPage;
